define('text!resources/wish/wish.html', ['module'], function(module) { module.exports = "<template class=\"${ canReserve && wish.isReserved ? 'reserved' : '' }\">\r\n\r\n    <img if.bind=\"wish.imgSrc\"\r\n         src.bind=\"wish.imgSrc\"\r\n         alt=\"Picture of ${ wish.title }\" />\r\n\r\n    <div class=\"title\"\r\n         textcontent.two-way=\"wish.title\"\r\n         contenteditable.bind=\"isEditing\"></div>\r\n\r\n    <p class=\"description\"\r\n       textcontent.two-way=\"wish.description\"\r\n       contenteditable.bind=\"isEditing\"></p>\r\n\r\n    <div class=\"actions\">\r\n        <div show.bind=\"canEdit\">\r\n            <button click.trigger=\"edit()\">\r\n                ${ isEditing ? 'Ok' : 'Edit' }\r\n            </button>\r\n            <button show.bind=\"isEditing\"\r\n                    click.trigger=\"delete()\">\r\n                Delete\r\n            </button>\r\n        </div>\r\n        <div show.bind=\"canReserve\">\r\n            <button hide.bind=\"wish.isReserved\"\r\n                    click.delegate=\"reserve()\">\r\n                Reserve\r\n            </button>\r\n        </div>\r\n    </div>\r\n\r\n    <p class=\"status\"\r\n       show.bind=\"canReserve && wish.isReserved\">\r\n        Reserved\r\n    </p>\r\n\r\n</template>\r\n"; });
